    true,nt"url": null,nt"notes": "EDFacts General Information, 2011-12 (EDFacts
    GI:2011-12), is one of 17 'topics' identified in the EDFacts documentation (in this
    database, each 'topic' is entered as a separate study); program data is available
    since 2005 at <ed.gov/about/inits/ed/edfacts>. EDFacts GI:2011-12 (ed.gov/about/inits/ed/edfacts)
    annually collects cross-sectional data from states about directory and descriptive
    information of the education units at the school, LEA, and SEA levels. EDFacts GI:2011-12
    data were collected using the EDFacts Submission System (ESS), a centralized portal,
    and their submission by states is mandatory and required for benefits. Not submitting
    the required reports by a state constitutes a failure to comply with law and may
    have consequences for federal funding to the state. Key statistics produced from
    EDFacts GI:2011-12 are from 7 data groups with information on Directory Information,
    Free and Reduced Price Lunch, Staff FTE, Teachers FTE, grades Offered, Magnet Status,
    and Student Membership. For the purposes of this system, data groups are referred
    to as 'variables', as a result of the structure and format of EDFacts' data.",nt"license_title":
